import React from "react";
import { Route, useHistory} from "react-dom/client";

export default function AuthRoute({ children }){
	const history = useHistory();
	
	if(!localStorage.getItem("SESSION_TOKEN")){
		history.push("/");
		return null;
	}
	return <Route{...{children}} />;
}
